const str = "";



/**
 *  Based on my Haskell solution:
 * 
foldPass :: String -> String
foldPass = foldr step []
    where step x (y:ys) | x /= y && toLower x == toLower y = ys
          step x ys                    = x : ys
*/


const foldPass = str => str.split("").reduce((acc, v) => 
    (acc.length >= 1 && v !== acc[0] && v.toLowerCase() == acc[0].toLowerCase() ) 
        ? acc.slice(1) 
        : [...acc, v], 
[]);

const part1 = foldPass(str).length;
